import React from 'react';
import s from './ProfileInfo.module.css'
import {ActionCreatorEditStatust} from "../../../Readux/Reducer-Profile";

const ProfileStatus = (props) =>{
    function handleChange(event) {
        console.log(event.target.value);
    }
    return        <div>
            <div><span>{props.profilestatus}</span></div>
            <div><input type="text"  value={props.profilestatus} onChange={handleChange} /></div>
        </div>


}
export default ProfileStatus;
